import './App.css';

function App() {
  return (
    <div className="App">
      <header className="header">
      <h1>Aina Pérez</h1>
      <p>Frontend Engineer</p>
      <nav id="top-menu">
            <ul class="row nav-list align-items-center">
              <li class="col-1"><a href="#about">About</a></li>
              <div class="col-4 line"></div>
              <li  class="col font-s text-center"><a href="#headliner">Aina Pérez</a></li>
              <div class="col-4 line"></div>
              <li class="col-1 text-end"><a href="#contact">Contact</a></li>
            </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
